import React, { useState } from 'react';
import './App.css';


function App() {

  const [ bbreak, setBreak ] = useState(False);


  return (

    <div className="App">
      <div className='nav'>
      <div className='break' onClick={() => setBreak(!bbreak)}> <h1>Break-Time </h1></div>
      <div className='quiz'> <h1> Quiz-Time </h1></div>
      <div className='lab'><h1>Lab-Time</h1></div>
    </div>
    </div>
  );
}

export default App;
